## Optimal Gene Sets

### Sequential Algorithm


::: {.cell}
::: {.cell-output-display}
![Gene Optimization for Sequential Classifier](results_files/figure-pdf/fig-gene-seq-1.pdf){#fig-gene-seq width=100%}
